import {StyleSheet, Text, View, TextInput, TouchableOpacity} from "react-native";

const Login = () => {
  return (
    <View style={styles.container}>


        <View style={styles.infoContainer}>
          <Text style={styles.titleText}>Login</Text>
          <View>
            <Text style={styles.altText}>Email</Text>
            <TextInput style={styles.inputBox}></TextInput>
            <Text style={styles.altText}>Password</Text>
            <TextInput secureTextEntry={true} style={styles.inputBox}></TextInput>
            <Text style={styles.altText}>Incorrect credentials, please try again.</Text>
          </View> 
        </View>
        <View style={styles.buttonBox}>
            <View style={styles.button}>
                  <TouchableOpacity>
                    <Text style={styles.defaultText}>Dismiss</Text>
                  </TouchableOpacity>
            </View>
        </View>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    fontFamily: "sf compact text",
  },

  infoContainer: {
    paddingLeft: "30px",
    paddingTop: "30px"

  },

  titleText: {
    fontSize: "50px",
    fontWeight: "700",
    letterSpacing: "1px",
  },

  altText: {
    color: "#000",
    fontSize: "17px",
    marginTop: "20px",
  },

  defaultText: {
    color: "#fff",
    fontSize: "17px",
  },

  inputBox: {
    marginTop: "5px",
    paddingLeft: "5px",
    paddingRight: "5px",
    paddingBottom: "5px",
    backgroundColor: "#F5F5F5",
    width: "90%",
    height: "50px",
    borderRadius: "10px",
    fontSize: "20px"
  },

  buttonBox: {
    width: "100%",
    alignItems: "center",
    position: 'absolute',
    bottom: "150px",
  },

  button: {
    marginTop: "7px",
    width: "250px",
    height: "50px",
    borderRadius: "7px",
    backgroundColor: "#0263FF",
    color: "white",
    alignItems: "center",
    justifyContent: "center"
  },
});

export default Login;
